import React, { useEffect, useState  } from "react";
import FavComponent from '../favorite/favComponent';
import axios from "axios";


export default function JobIdComponent(props) {
    const [allFavIds, setAllFavIds] = useState([]);
    const user = props.userName;


    function findAllPokemon(username) {
        console.log("user:",username);
        axios.get('api/users/findFavorite/' + username)
            .then(response => {
                setAllFavIds(response.data)
            })
            .catch(error => console.error(error));
    }

    useEffect(findAllPokemon(user), []);
        return (
            <div className="card">
               Name: {user}
               List:{allFavIds}
            </div>
        );
    }
